import React from "react";
import TeamMember from "./TeamMember";

function Team () {
    const info=[
        {img:'/images/AhouziYoussef.jpg',name:'Ahouzi Youssef', position:'CEO at PortNet',phone:'+212 12345678' ,email:'Ahouzi@PortNet.com',website:'AhouziPortNet.com',},
        {img:'/images/MehdiELMUILHI.jpg',name:'Mehdi EL MUILHI',position:'Chief Financial and Administrative Officer',phone:'+212 12345678' ,email:'Mulhi@PortNet.com',website:'MulhiPortNet.com',},
        {img:'/images/MehdiTazi.jpg',name:'Mehdi Tazi',position:'Project Manager',phone:'+212 12345678' ,email:'Tazi@PortNet.com',website:'TaziPortNet.com',},
        {img:'/images/NabilOuzire.jpg',name:'Nabil ouzire', position:'Project Manager',phone:'+212 12345678' ,email:'ouzire@PortNet.com',website:'ouzirePortNet.com',},
        {img:'/images/SaidAITBENALI.jpg',name:'Said AIT BEN ALI',position:'Senior Java JEE Developer',phone:'+212 12345678' ,email:'AitBenAli@PortNet.com',website:'AitBenAliPortNet.com',},
        {img:'/images/RymeBensbih.jpg',name:'Ryme Bensbih',position:'Communication and Change Management Manager',phone:'+212 12345678' ,email:'Bensbih@PortNet.com',website:'BensbihPortNet.com',}   
    ]

    const members = info.map(member => <TeamMember 
                        img ={member.img} 
                        name ={member.name}
                        position={member.position}
                        phone={member.position}
                        email={member.email}
                        website={member.website}
            />);


    return(
        <div className="row">
            {members}
        </div>
    )
}

export default Team;
